  },
);

customPost.allow post method for a custom path with:
const response = await client.customPost({
  path: 'test/all',
  parameters: { query: 'parameters' },
  body: { body: 'parameters' },
});

customPost.requestOptions can override default quer:
const response = await client.customPost(
  { path: 'test/requestOptions', parameters: { query: 'parameters' }, body: { facet: 'filters' } },
  {
    queryParameters: { query: 'myQueryParameter' },
  },
);

customPost.requestOptions merges query parameters w:
